angular.module("hammersCalendar").run(["$templateCache",function(n){n.put("app.html",'<header hc-nav></header>\n<main>\n    <div class="container">\n        <hc-content games="games" search="search"></hc-content>\n    </div>\n</main>'),n.put("content.html",'<div>\n    <hc-game ng-repeat="game in currentGames | orderBy:\'datePlayed\' track by game.id"\n             game="game"\n             current-ticket-type="currentTicketType"\n             has-result="game.hasResult">\n    </hc-game>\n</div>\n'),n.put("game.html",'<div class="card game-small show-on-small hide-on-med-and-up"\n     ng-class="{\'home\' : game.homeTeam.isWestHam, \'away\' : game.awayTeam.isWestHam}">\n    <a href="#game-modal-{{game.id}}" class="waves-effect waves-custom" modal open="open">\n        <div class="card-content">\n            <div class="row valign-wrapper">\n                <div class="col s3">\n                    <div class="team-logo {{game.homeTeam.logo}}"></div>\n                </div>\n                <div class="col s7">\n                    <div class="valign">\n                        <div>{{game.opponents}}</div>\n                        <div>{{game.datePlayed | customDate:\'EEE dth MMM, h:mm!a\'}}</div>\n                    </div>\n                </div>\n                <div class="col s2">\n                    <div class="valign">\n                        {{game.hasResult ? game.homeTeam.score + \' - \' + game.awayTeam.score : \'v\'}}\n                    </div>\n                </div>\n            </div>\n        </div>\n    </a>\n</div>\n\n<div id="game-modal-{{game.id}}" class="modal modal-fixed-footer">\n    <div class="modal-content">\n        <h4>{{game.opponents}}</h4>\n        <div class="container">\n            <div class="row valign-wrapper">\n                <div class="col s6 valign left-align">\n                    <div ng-if="game.competitionLogo" class="competition competition-logo {{game.competitionLogo}} left-align"\n                         title="{{game.competition}}"></div>\n                    <span ng-if="!game.competitionLogo" class="left-align">{{game.competition}}</span>\n                </div>\n                <div class="col s6 valign right-align">\n                    <span ng-if="game.homeTeam.isWestHam">Home</span>\n                    <span ng-if="game.awayTeam.isWestHam">Away</span>\n                </div>\n            </div>\n            <div class="row valign-wrapper" ng-if="game.showAttended">\n                <div class="col s6 valign">\n                    Attended\n                </div>\n                <div class="col s6">\n                    <div class="switch valign right">\n                        <label>\n                            <input type="checkbox" ng-model="game.attended">\n                            <span class="lever"></span>\n                        </label>\n                    </div>\n\n                </div>\n            </div>\n        </div>\n    </div>\n    <div class="modal-footer">\n        <a href="#!" class="modal-action modal-close waves-effect waves-custom btn-flat ">\n            <i class="material-icons">clear</i>\n        </a>\n        <a class="waves-effect waves-custom btn-flat " ng-if="game.locationUrl"\n           ng-href="{{game.locationUrl | jsonDecode}}" target="_blank">\n            Map\n        </a>\n        <a class="waves-effect waves-custom btn-flat "\n           ng-if="game.tickets[currentTicketType.key] && game.tickets[currentTicketType.key].url"\n           ng-href="{{game.tickets[currentTicketType.key].url | jsonDecode}}" target="_blank">\n            Tickets\n        </a>\n    </div>\n</div>\n\n<div class="card hide-on-small-only">\n    <div class="card-content">\n        <div class="game row valign-wrapper">\n            <div class="col s2">\n                <div class="valign">\n                    <div>{{game.datePlayed | customDate:\'EEE dth MMM, h:mm!a\'}}</div>\n                    <div ng-if="game.tickets[currentTicketType.key] && game.tickets[currentTicketType.key].date">\n                        {{game.tickets[currentTicketType.key].date | customDate:\'EEE dth MMM\'}}\n                    </div>\n                </div>\n            </div>\n            <div class="col s1 center-align">\n                <div ng-if="game.competitionLogo" class="competition competition-logo {{game.competitionLogo}}"\n                     title="{{game.competition}}"></div>\n                <span ng-if="!game.competitionLogo">{{game.competition}}</span>\n            </div>\n            <div class="col s7">\n                <div class="game-details">\n                    <div hc-team-name class="team right-align" team="game.homeTeam"></div>\n                    <div class="team-logo {{game.homeTeam.logo}} no-flex" ng-if="game.homeTeam.logo"></div>\n                    <!-- Result -->\n                    <div ng-if="game.hasResult" class="versus" ng-class="{\'withShoot\': game.hasShootout}">\n                        <span class="home">\n                            <span ng-class="{\'west-ham\': game.homeTeam.isWestHam}">{{game.homeTeam.score}}</span>\n                        </span>\n                        <span class="hyphen">-</span>\n                        <span class="away">\n                            <span ng-class="{\'west-ham\': game.awayTeam.isWestHam}">{{game.awayTeam.score}}</span>\n                        </span>\n                        <div ng-if="game.hasShootout" class="shoot">\n                            <span class="home">\n                                <span ng-class="{\'west-ham\': game.homeTeam.isWestHam}">({{game.homeTeam.shootout}}</span>\n                            </span>\n                            <span class="hyphen">-</span>\n                            <span class="away">\n                                <span ng-class="{\'west-ham\': game.awayTeam.isWestHam}">{{game.awayTeam.shootout}})</span>\n                            </span>\n                        </div>\n                    </div>\n                    <div ng-if="!game.hasResult" class="versus">v</div>\n                    <div class="team-logo {{game.awayTeam.logo}} no-flex" ng-if="game.awayTeam.logo"></div>\n                    <div hc-team-name class="team left-align" team="game.awayTeam"></div>\n                </div>\n            </div>\n            <div class="col s2">\n                <div class="switch valign right" ng-if="game.showAttended">\n                    <label>\n                        <input type="checkbox" ng-model="game.attended">\n                        <span class="lever"></span>\n                    </label>\n                </div>\n            </div>\n        </div>\n    </div>\n    <div class="card-action">\n        <a class="right"\n           ng-if="game.tickets[currentTicketType.key] && game.tickets[currentTicketType.key].url"\n           ng-href="{{game.tickets[currentTicketType.key].url | jsonDecode}}" target="_blank">\n            Tickets\n        </a>\n        <a class="right" ng-if="game.matchReport" ng-href="{{game.matchReport | jsonDecode}}" target="_blank">\n            Match\n        </a>\n        <a class="right" ng-if="game.locationUrl" ng-href="{{game.locationUrl | jsonDecode}}" target="_blank">\n            Map\n        </a>\n        <a href="#"></a>\n    </div>\n</div>\n'),n.put("nav.html",'<!-- top navigation -->\n<div id="topnav" class="navbar-fixed">\n    <nav class="top-nav">\n        <div class="container">\n            <div class="nav-wrapper">\n                <a href="#!" class="page-title hide-on-small-only">Hammers Calendar</a>\n                <a href="#!" class="page-title show-on-small hide-on-med-and-up">{{currentMonth.date | customDate:"MMM \'\'yy"}}</a>\n                <ul class="right hide-on-med-and-down">\n                    <li>\n                        <a class="dropdown-button" href="#!" data-activates="season-dropdown" hc-nav-dropdown>\n                            {{currentSeason.season}} / {{currentSeason.season + 1}}\n                            <i class="material-icons right">arrow_drop_down</i>\n                        </a>\n                        <ul id="season-dropdown" class="dropdown-content">\n                            <li ng-repeat="season in seasons track by season.season">\n                                <a ng-click="alterSeason(season)">{{season.season}} / {{season.season + 1}}</a>\n                            </li>\n                        </ul>\n                    </li>\n                    <li>\n                        <a class="dropdown-button" href="#!" data-activates="tickettype-dropdown" hc-nav-dropdown>\n                            {{currentTicketType.label}} sale date<i class="material-icons right">arrow_drop_down</i>\n                        </a>\n                        <ul id="tickettype-dropdown" class="dropdown-content">\n                            <li ng-repeat="ticketType in ticketTypes">\n                                <a ng-click="alterTicketType(ticketType)">{{ticketType.label}} sale date</a>\n                            </li>\n                        </ul>\n                    </li>\n                    <li>\n                        <a class="dropdown-button" href="#!" data-activates="opponents-dropdown" hc-nav-dropdown>\n                            <span ng-if="currentOpponents">{{currentOpponents}}</span><span ng-if="!currentOpponents">Opponents</span> <i class="material-icons right">arrow_drop_down</i>\n                        </a>\n                        <ul id="opponents-dropdown" class="dropdown-content">\n                            <li ng-repeat="opponents in possibleOpponents | orderBy:\'+\'">\n                                <a ng-click="alterOpponents(opponents)">{{opponents}}</a>\n                            </li>\n                        </ul>\n                    </li>\n                    <li ng-if="authenticationLink">\n                        <a ng-if="user" ng-href="{{authenticationLink}}">Logout {{user}}</a>\n                        <a ng-if="!user" ng-href="{{authenticationLink}}">Login</a>\n                    </li>\n                </ul>\n            </div>\n        </div>\n        <!-- nav button -->\n        <div class="container">\n            <a href="#"\n               class="button-collapse top-nav full hide-on-large-only"\n               data-activates="nav-mobile" data-sidenav="left" data-menuwidth="240" data-closeonclick="false">\n                <i class="material-icons">menu</i>\n            </a>\n        </div>\n    </nav>\n</div>\n<!-- side nav -->\n<ul id="nav-mobile" class="side-nav fixed">\n    <!--Maybe a logo?-->\n    <li class="logo hide-on-med-and-down" style="margin-left: -15px;">\n        <a id="logo-container" href="#" class="brand-logo">\n            <i class="material-icons large">alarm</i>\n        </a>\n    </li>\n\n    <li class="hide-on-large-only" ng-if="authenticationLink">\n        <a ng-if="user" ng-href="{{authenticationLink}}">Logout {{user}}</a>\n        <a ng-if="!user" ng-href="{{authenticationLink}}">Login</a>\n    </li>\n    <li class="hide-on-large-only">\n        <select class="browser-default"\n                ng-options="season as season.season for season in seasons | orderBy:\'-season\' track by season.season"\n                ng-model="currentSeason"\n                ng-change="alterSeason(currentSeason)">\n        </select>\n    </li>\n    <li class="hide-on-large-only">\n        <select class="browser-default"\n                ng-options="ticketType as ticketType.label for ticketType in ticketTypes track by ticketType.key"\n                ng-model="currentTicketType"\n                ng-change="alterTicketType(currentTicketType)">\n        </select>\n    </li>\n    <li class="hide-on-large-only">\n        <select class="browser-default"\n                ng-options="opponents as opponents for opponents in possibleOpponents"\n                ng-model="currentOpponents"\n                ng-change="alterOpponents(currentOpponents)">\n            <option value="" disabled>Opponents</option>\n        </select>\n    </li>\n    <li ng-repeat="month in currentSeason.months track by month.id" class="bold">\n        <a ng-click="alterMonth(month)" class="waves-effect waves-custom">\n            {{month.date | customDate:\'MMMM\'}}\n            <span class="badge">{{month.games.length}}</span>\n        </a>\n    </li>\n</ul>\n'),n.put("result.html",'<div ng-class="{\'withShoot\': game.hasShootout, \'versus\': true}">\n    <span class="home">\n        <span ng-class="{\'westHam\': game.homeTeam.isWestHam}">{{game.homeTeam.score}}</span>\n    </span>\n    <span class="hyphen">-</span>\n    <span class="away">\n        <span ng-class="{\'westHam\': game.awayTeam.isWestHam}">{{game.awayTeam.score}}</span>\n    </span>\n    <div ng-if="game.hasShootout" class="shoot">\n        <span class="home">\n            <span ng-class="{\'westHam\': game.homeTeam.isWestHam}">{{game.homeTeam.shootout}}</span>\n        </span>\n        <span class="hyphen">-</span>\n        <span class="away">\n            <span ng-class="{\'westHam\': game.awayTeam.isWestHam}">{{game.awayTeam.shootout}}</span>\n        </span>\n    </div>\n</div>'),n.put("team-logo.html",'<div class="team-logo {{team.logo}}" ng-if="team.logo"></div>\n'),n.put("team-name.html","{{team.isWestHam ? 'West Ham United' : team.name}}")}]);